This quadratic equation cannot be factored using integer coefficients, so we need to use the quadratic formula, which is given by:

x = [-b ± sqrt(b^2 - 4ac)] / 2a

For the given quadratic equation 10x^2 - 520x + 6779 = 0, the coefficients are a = 10, b = -520, and c = 6779. 

Using these values in the quadratic formula, we have:

x = {[520 ± sqrt((-520)^2 - 4*10*6779)] / (2 * 10)}
  = {[520 ± sqrt(270400 - 270360)] / 20}
  = {[520 ± sqrt(40)] / 20}
  = {[520 ± 2*sqrt(10)] / 20}
  = {26 ± sqrt(10)} 

So the roots of the given quadratic equation are x = 26 + sqrt(10) and x = 26 - sqrt(10).
